    '/auth/reset-password-confirm',
];

const ROUTES_WITHOUT_SIDEBAR = [
    '/admin/project',
    '/admin/project-select',
    '/admin/project/new',
]

const APP_CONSTANTS = {
    LOGIN_TO_APP_ROUTES,
    ROUTES_WITHOUT_SIDEBAR
